import React, {Component}  from 'react';
import OurCard from './CardService';
import {Container, Row, Col} from 'reactstrap';

class CardFrame extends Component {
    state={
        vaga:[
            {nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível"} ,
            {nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível"} ,
            {nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível"} ,
            {nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível"} ,
        ]


    }

    render() {
        let details=this.state.vaga.map(singleVaga=>{
            return(
                <Col>
                <OurCard details ={singleVaga} />
                </Col>
            )
        })
    return(
<div>
    <Container>
        <Row>
            {details}
        </Row>
    </Container>
</div>

    )

    }


}

export default CardFrame;
